import React from 'react'

function Categories(props) {
  return (
    <>
     <div className="menu-tab d-flex justify-content-around">
          <button className="btn btn-warning" onClick={()=>props.filterMenu('breakfast')}>Breakfast</button>
          <button className="btn btn-warning" onClick={()=>props.filterMenu('lunch')}>Lunch</button>
          <button className="btn btn-warning" onClick={()=>props.filterMenu('snacks')}>Snacks</button>
          <button className="btn btn-warning" onClick={()=>props.filterMenu('dinner')}>Dinner</button>
          {/* <button className="btn btn-warning" onClick={()=>setItem(Menu)}>All</button> */}
        </div> 
    </>
  )
}

export default Categories;
